    ]

    const [activeTab, setActiveTab] = useState('0')



    return ( 
        <div className="admin-container">
            {/* <NavBar setActiveTab={setActiveTab} tabs={tabs}/>
            <Body tabs={tabs}/> */}
            <SubTabs tabs={tabs}/>
        </div>
     );
}

